      return fetch('http://localhost:1235/salesman/', {
          method: 'POST',
          headers: {
              'Content-Type': 'application/json'
          },
          body: JSON.stringify(data)
      })
          .then((response) => response.json())
          .then((data) => {
              console.log("Create Success: ", data);
          })
          .catch((error) => {
              console.error("ERROR: ", error);
          })
  }

